// AddProductForm.js
import React, { useState } from 'react';
import './AddProductPage.css';

const AddProductPage = () => {
  const[productName, setproductName] = useState("");
  const[productPrice, setproductPrice] = useState("");
  const[productCategory, setproductCategory] = useState("");
  const[productuserId, setproductuserId] = useState("");
  const[productCompany, setproductCompany] = useState("");

  const handleAddProduct = () => {
    console.log(productName, productPrice, productCategory, productuserId, productCompany);
  }

  return (
    <form className="add-product-form">
      <h2 className="title">Add Product</h2>
      <label htmlFor="productName">Product Name:</label>
      <input
        type="text"
        value={productName}
        onChange={(e) => setproductName(e.target.value)}
        required
      />
      <label htmlFor="productPrice">Product Price:</label>
      <input
        type="number"
        value={productPrice}
        onChange={(e) => setproductPrice(e.target.value)}
        required
      />
      <label htmlFor="productCategory">Product Category:</label>
      <input
        type="text"
        value={productCategory}
        onChange={(e) => setproductCategory(e.target.value)}
        required
      />
      <label htmlFor="productuserId">Product UserId:</label>
      <input
        type="text"
        value={productuserId}
        onChange={(e) => setproductuserId(e.target.value)}
        required
      />
      <label htmlFor="productCompany">Product Company:</label>
      <input
        type="text"
        value={productCompany}
        onChange={(e) => setproductCompany(e.target.value)}
        required
      />
      <button className="button" type="submit" onClick={handleAddProduct}>Add Product</button>
    </form>
  );
};

export default AddProductPage;
